import { Colors } from "../theme";

export const leftContactCard ={
    padding:'20px',
    background: Colors.primary,
    '& h4':{
        color:Colors.white,
        fontWeight:600,
        textAlign:'center',
    },
    '& > span':{
        color:Colors.light_gray,
        textAlign:'center',
    }

}
export const styledListButton = {
    display:'flex',
    alignItems:'center',
}
